import React, { Component } from 'react'

export default class test extends Component {
  constructor(props){
    super(props)


    this.state = {
      secound : 1,
      secoundDef : 1
    }
  }
  componentDidMount(){
    this.count();
  }

  count = ()=>{
    setInterval(() => {
      if(this.state.secound === 5){
        console.log('Event');
        this.setState({ secound : this.state.secoundDef })
      }else{
        var secound = this.state.secound+1;
        this.setState({secound : secound});
      }
    }, 1000);


  }

  render() {
    var today = new Date();
    var dateToDay = today.getFullYear()+'-'+today.getMonth()+'-'+today.getDate();

    return (
      <div>
        <Header />
        <h3>To Day is : {dateToDay} : {this.state.secound}</h3>
      </div>
    )
  }
}

class Header extends Component {
  render() {
    return (
      <div style={{color: 'pink'}}>
        <h1>Happy Coding By React</h1>
        <h4>By K.COPTER</h4>
      </div>
    )
  }
}
